<template>
    <div class="xinzi">
        <div class="xinzi-header-pic"></div>
        <div class="xinzi-title">
            {{count < 100 ? '正在查询设计师薪资情报' : '您的情报查询完毕'}}
        </div>
        <div class="xinzi-progress">
            {{count}}%
        </div>
        <div class="xinzi-print">
            <div class="xinzi-print-shadow"></div>
            <div
                :class="[
                    'xinzi-print-exit',
                    run ? 'xinzi-print-exit-run' : ''
                ]"
            >
                <div :class="[
                        'xinzi-print-paper',
                        run ? 'xinzi-print-paper-run' : ''
                    ]">
                    <div class="xinzi-print-paper-watermark"></div>
                    <div
                        class="xinzi-print-paper-line"
                        v-for="(item, index) in titles" :key="index + ''"
                    >
                        <div>
                            {{item}}
                        </div>
                        <div>
                            情报获取中
                        </div>
                    </div>
                    <div class="xinzi-print-paper-more">
                        更多情报正在收集中
                    </div>
                </div>
            </div>
        </div>
    </div>
</template>
<script>
export default {
    data () {
        return {
            titles: ['#2018设计师进阶薪资', '#互联网薪资对比', '#2018设计师进阶薪资', '#互联网薪资对比'],
            count: 0,
            time: 3000,
            timer: null,
            run: false
        }
    },
    mounted () {
        this.timer = setInterval(() => {
            if (this.count >= 100) {
                clearInterval(this.timer)
                this.timer = null
                return
            }
            this.count++
        }, 3000 / 100)
        setTimeout(() => {
            this.run = true
        }, 0)
    }
}
</script>
